!function () {
    const input = document.querySelector(".app-body-right-top input");
    input.oninput = () => {
        for (const e of document.querySelectorAll(".app-body-right-bottom>*")) {
            if (e.innerText.includes(input.value)) {
                e.style.display = ""
            } else {
                e.style.display = "none"
            }
        }
    }
}()
!function () {
    document.querySelector(".dialog-title div").addEventListener("click", function () {
        document.querySelector(".dialog-shadow").style.display = "none"
    })
    function update(thi, data) {
        if (document.querySelector(".dialog-body-right-codecreatevalue-v").checked) {
            document.querySelector(".dialog-body-right-codecreate-hasid").removeAttribute("hidden", "")
            document.querySelector("." + thi.className.replace("value", "")).innerText = ""
            document.querySelector(".dialog-body-right-codecreate-v").innerText = data[thi.value]
            document.querySelector(".dialog-body-right-codecreate-douh").setAttribute("hidden", "")
        } else {
            document.querySelector(".dialog-body-right-codecreate-hasid").setAttribute("hidden", "")
            if (thi.value !== "0") {
                document.querySelector("." + thi.className.replace("value", "")).innerText = thi.value
                document.querySelector(".dialog-body-right-codecreate-douh").removeAttribute("hidden", "")
            } else {
                document.querySelector("." + thi.className.replace("value", "")).innerText = ""
                document.querySelector(".dialog-body-right-codecreate-douh").setAttribute("hidden", "")
            }
        }
    }
    var a = document.querySelector(".dialog-body-right-codecreatevalue").children;
    for (let b of a) {
        if (b.localName === "input") {
            b.addEventListener("change", function () {
                var c = Number(this.value);
                if (isNaN(c)) c = 0;
                if (c < 0) c = ~~(-c);
                if (c % 1 !== 0) c = ~~(c);
                this.value = c;
                document.querySelector("." + this.className.replace("value", "")).innerText = c;
            });
        } else if (b.localName === "select") {
            b.addEventListener("change", function () {
                var data = JSON.parse(document.querySelector(".dialog-body-right-codecreatevalue data").innerText)
                update(this, data)
            });
        } else if (b.localName === "span") {
            //
        } else if (b.localName === "data") {
            //
        } else {
            b.querySelector("input").addEventListener("change", function () {
                document.querySelector("." + this.className.replace("value", "")).innerText =
                    !this.checked ? `"${document.querySelector(".dialog-body-right-information-name").innerText}"` : document.querySelector(".dialog-body-right-information-id").innerText;
                document.querySelector("." + this.className.replace("value", "")).className =
                    this.checked ? "codeNumb dialog-body-right-codecreate-v" : "codeStri dialog-body-right-codecreate-v";
                update(document.querySelector(".dialog-body-right-codecreatevalue-xzm"), JSON.parse(document.querySelector(".dialog-body-right-codecreatevalue data").innerText))
            });
        }
    }
}();
